// src/pages/About.js
import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about">
      <h1>About Me</h1>
      <p>Hi, I'm Aruj! I'm a software engineering student pursuing a 2+2 global course at Chitkara University and Deakin University.</p>
      <p>I love coding, building projects, and exploring new technologies.</p>
    </div>
  );
};

export default About;
